import Typography from '@material-ui/core/Typography'
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import Grid from '@material-ui/core/Grid';


const useStyles = makeStyles({
    TypographyStyle:{
        // fontweight: 800
    }

})

export default function Thirdrow() {
  const classes = useStyles();
    return(<>
            <Divider id="idofhrform4" variant="middle" />
        <Typography id="Typographyid">
           Delete Accounts
        </Typography>

             <Box display="flex">
             <Box flexGrow={0.73} >
             <Typography id="Typographyid2Del">
                           By deletinng your account your account you will losee all your data
             </Typography>
             </Box>              
             <Box p={1}>
             <Button id="   " >Delete account..</Button>
            </Box>
            
            <Divider id="idofhrform4" variant="middle" />
           
            <Grid  container justify="flex-end">
   
            <Button id="lastbtn" variant="contained" color="primary">
            Primary
            </Button>
            </Grid>
            </Box>
            
           
        </>
    );
}
